  },

  actions: {
    submitOrder(ctx, payload) {
      return client.post("/api/order/submit", payload)
        .then((response) => {
          return response
        })
    },
    trackOrder(ctx) {
      console.log(orderId)
      return client.post(`/api/order/${orderId}`)
